const splitTreasuries = () => {
  const today = dayjs();
  const oneYearAgo = today.subtract(1, "year");
  const currentTreasuries = mockPastCMB.filter((treasury) => {
    return dayjs(treasury.issueDate).isBefore(oneYearAgo);
  });
  return currentTreasuries;
};

